import React, { Fragment } from 'react';

const Profile = ({count, name, username, email}) => {
    return(
         <Fragment>
             <li></li>
             <li>name</li>
             <li>username</li>
             <li>email</li>
         </Fragment>
    )
}

export default Profile;
